import { Injectable } from '@angular/core';
import { HttpClient, HttpHeaders, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';
import { Patient } from 'src/app/models/Patient';
@Injectable({
  providedIn: 'root'
})
export class PatientbackService {

  private apiUrl = 'https://localhost:7129/api/Patient';

  constructor(private http: HttpClient) { }

  create2(patient: Patient): Observable<HttpResponse<any>> {
    return this.http.post<any>(`${this.apiUrl}/create2`, patient, { observe: 'response' });
  }

